				<div data-v-131826cb="" id="anchor" class="main-content">
					<div data-v-131826cb="" class="qa-font-wrapper">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor0_0" class="color-black">我如何办理取车手续？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">本人携带身份证（首次用车需携带身份证原件，二次或多次用车支持电子身份证）、驾驶证（首次用车需携带驾驶证原件，二次或多次用车支持电子驾驶证）、信用卡（免除全部押金、或线上支付押金的客户无需携带信用卡）及面签协议书（限校园业务）到指定地点提车即可；您也可以预订送车上门/上门取车服务。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor0_1" class="color-black">我租的车其他人可以开吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">不可以。车辆必须只能由预订本人使用，不得出租、转借。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor0_2" class="color-black">用车期间油费怎么计算，我需要加油吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">行驶期间的油费需要您自理，还车时车辆管理员会根据您的油量使用情况和原油位进行对比，以多退少补原则处理油费。您需确保还车时油箱中有油。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor0_3" class="color-black">还车业务如何办理？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">请您按照约定时间到达指定还车地点，也可预订上门取车服务，车辆运营专员会核实车况（如外观、轮胎等）后填写相关单据，如无问题，您结算订单即可。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor1_0" class="color-black">租金、基本保障服务费、手续费的是如何计费的？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">①租金由日租金及时租金构成，租金总额=日租金*租期整日部分+时租金*租期非整日部分，当时租金*租期非整日部分＞日租金时，按日租金计费。时租金及日租金均以系统所示为准。<br>②基本保障服务费由日基本保障服务费及时基本保障服务费构成，基本保障服务费总额=日基本保障服务费*租期整日部分+时基本保障服务费*租期非整日部分，当时基本保障服务费*租期非整日部分＞日基本保障服务费时，按日租金计费。时基本保障服务费及日基本保障服务费均以系统所示为准。<br>③手续费，每笔订单只收取一次手续费，不同类型网点手续费金额不同，高铁/机场网点35元/单，其他网点20元/单。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor1_1" class="color-black">油费如何计算？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">按照取还车的油量差按多退少补原则处理油费。油费=油量比例差值*油箱容积*油费市场价。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor1_2" class="color-black">车损无忧服务和补充险怎么收费？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">①车损无忧服务<i>50</i>元/天，以系统所示金额为准；<br>②补充险按系统所示金额收费，最低<i>1</i>天起收，整日部分按天计费；超整日部分的，不足<i>2</i>小时免收，<i>2</i>小时以上（含）且不足<i>6</i>小时的收取半日费用，<i>6</i>小时以上（含）收取整日费用。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor1_3" class="color-black">什么情况会加收夜间服务费？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">凡订单“实际取车时间或实际还车时间”介于<i>【</i>晚<i>21:00</i>至次日早<i>8:00】<i><i>时段内（含整点），每次需加收夜间服务费</i><i>50</i><i>元；每单最高收取</i><i>100</i><i>元。</i></i></i></div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor2_0" class="color-black">我的订单费用包括什么内容？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">您的订单费用包括：车辆租金、基本保障服务费、手续费，如您预订了车损无忧服务及补充险则还有车损无忧费用及补充险费用，以及可能产生的油费、夜间服务费等。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor3_0" class="color-black">如何成为悟空租车的注册会员？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">在注册页面，输入手机号，随后点击“获取验证码”，系统会发送短信验证码至您的注册手机号码上，请您再输入验证码，点击“确定”即可成为注册会员。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor4_0" class="color-black">悟空租车注册会员如何实名认证？实名认证需要多久？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">登录账户，点击“实名认证”，输入真实姓名和身份证号，提交即可。系统会在30分钟内反馈信息。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor4_1" class="color-black">我需要达到什么条件才能通过悟空租车实名认证审核？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">①首先确保您的关键信息：姓名、身份证号码正确无误；<br>②持有有效期超过半年的地方驾驶证，其所示的身份证号须与身份证上所示一致，须正本及副本完整；<br>③持有有效的大陆二代身份证；暂不支持港、澳、台及国际用户租车。<br>④两年内（无）有关危险驾驶和（或）无保险驾驶前科记录；<br>⑤无交通意外发生记录，或没有被拒绝投保；或在过去的2年中没有被停保的记录；<br>⑥没有个人信用瑕疵或刑事记录。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor5_0" class="color-black">订单金额是预定时先付还是可以还车时付全款？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">预订时先付。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor5_1" class="color-black">我可以使用多张信用卡进行租车预授权担保吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">原则上不可以，但是可以和门店协商。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor6_0" class="color-black">我可以更改或取消订单吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">可以。在距离预订取车时间<i>2</i>小时以上免费取消订单；取车前<i>2</i>小时（含）内取消订单，您需承担订单首日租金作为违约金，违约金最高不超过<i>150</i>元（亦不超过订单总金额）。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor6_1" class="color-black">我可以提前还车吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">可以。<br>①平日订单：需在预计还车时间前<i>2</i>小时通知门店，以修改后的租期计费（不计活动补贴）与按原租期计费（不计活动补贴）的差价的<i>20</i>%收取退改费；<br>②活动及节假日订单：以平台实时公布的规则为准，若无特殊说明则与平日一致。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor6_2" class="color-black">如果来不及还车可以延长用车时间吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">可以。<br>①如果客户在租期结束后延期归还车辆，延期<i>1</i>小时以内还车的，无需提前办理手续，延期用车时间将计入总租期，客户需在还车时根据总租期支付相应费用；<br>②延期1小时以上还车的，视为续租，需在租期届满前提前3小时提出续租申请，3小时内无法申请续租，续租成功需同时满足如下条件：<br>a)门店库存调配情况允许该车辆续租；<br>b)续租后单次总租期（已租+续租）不超过30天（含）；<br>c)除V8客户外，续租需按期支付续租费用。<br>③超过预订还车时间，而客户因个人原因未履行有效续租手续强行不还车的，视为强行续租。未履行有效续租手续是指：<br>●未提前告知且延期还车<i>1</i>小时以上的；<br>●未经门店或悟空平台同意强行不还车的；<br>●到预订还车时间无法与客户联系上的。<br>满足任一以上情况，则门店有权立即收回车辆。客户除支付正常租车费用外，还需按超期部分租金的<i>300%</i>支付违约金。在租车城市以外地区收回车辆的，客户需加付异地还车费，根据城市间的距离，按<i>3</i>元/公里计价。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor7_0" class="color-black">我怎样在悟空租车预订车辆？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">注册并完成实名认证后，设置取/还车的时间、地点，选择心仪车辆，提交预订即可。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor7_1" class="color-black">如果悟空租车无法提供已预订的车辆时会如何处理？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">如无法为您提供已预订的车辆，则我们会有工作人员与您联系，及时为您调配。每人同时只能预订租期不重合的两辆车。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor7_2" class="color-black">我每次租车数量有限制吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">每人同时只能预订租期不重合的两辆车，且最多两辆。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor7_3" class="color-black">租车期限有时间限定吗？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">您可按照每小时，每天为单位租车。租期最少<i>1</i>小时，最长<i>30</i>天。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor8_0" class="color-black">我在租车期间发生违章如何处理?</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">若出现违章情况，工作人员会和您联系处理，原则上您需要自行处理违章，如不方便也可以和门店工作人员协商并委托其代为处理。门店工作人员或悟空租车平台有权从违章押金中扣除相应款项，不足部分需您补足。</div>
							</div>
						</div>
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor8_1" class="color-black">违章押金什么时候退？</div>
							</div>
							<div data-v-131826cb="" class="common-a">
								<div data-v-131826cb="" class="color-gray">待工作人员确定无违章后，会在30天退还违章押金。</div>
							</div>
						</div>
					</div>
					<div data-v-131826cb="" class="qa-font-wrapper" style="display: none;">
						<div data-v-131826cb="" class="common-qa">
							<div data-v-131826cb="" class="common-q">
								<div data-v-131826cb="" id="anchor9_0" class="color-black">用车期间遇到事故出险怎么办？车辆发生故障怎么办？</div>
